import React, { Component } from 'react'
import ReactDOM from 'react-dom'
import Footer from './Components/Footer.js'
import Carousel from './Components/Carousel.js'
import './styles.scss'
import Swiper from 'react-id-swiper'
import Slider from './Components/slider.js'
import Article from './Components/Article.js'
import 'slick-carousel/slick/slick.css'
import 'slick-carousel/slick/slick-theme.css'
import logo from './img/logo.png'
import Navigation from './Components/Navigation.js'

class App extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      items: []
    }
  }

  componentDidMount () {
    fetch('http://46.188.118.134:8082/types?name_en=News')
      .then(response => response.json())
      .then(parsJSON => {
        console.log(parsJSON)
        this.setState({
          items: parsJSON
        })
      })
  }
  render () {
    return (
      <div>
        <section className='hero is-primary'>
          <div className='container'>
            <div className='navbar-brand'>
                <figure class='image is-128x128'>
                  <img isSize='16x16' src={logo} />
                </figure>
              <h1 className='title'>
                Факультет Международных образовательных программ МГТУ им. Н.Э.Баумана
              </h1>
            </div>
          </div>
          <div className='FootHeader'>
            <Navigation type='header' />
          </div>
        </section>
        <Carousel slides={[
          {
            'image': 'https://place-hold.it/500x500&text=slide1',
            'text': '1'
          },
          {
            'image': 'https://place-hold.it/500x500&text=slide2',
            'text': '2'
          }

        ]} />
        <Article type='null' />
        <Article type='News' />

        <Footer />

      </div>

    )
  }
}
ReactDOM.render(<App />, document.getElementById('root'))
